import React from "react";
import "./style.css";

function Header() {
  return (
    <header className="header">
      <div className="titletext">
        <h1>Travel Clicky Game</h1>
        <h2>A Memory Game based on favorite travel destinations.</h2>
        <h3>Click on a new destination each time to score a point, double click the same and lose</h3>
      </div>

    </header>
  );
}
export default Header;
